import React from 'react';
import {Link} from 'react-router-dom'
const NavBar = ()=>{
    return (
        <>
        <h1>Nav bar navigation</h1>

        <Link to="/">About</Link>
        <Link to ="/contact">Contact</Link>
        =================
        
        <a href='About'>About</a>
        <a href='/contact'> Contact </a>
        </>
    )
}

export default NavBar;
